-- ----------------------------
-- Table structure for MOBILE_RESOURCE
-- ----------------------------
DROP TABLE IF EXISTS `DEV_DFC`;
CREATE TABLE `DEV_DFC` (
  `ID` varchar(20) NOT NULL COMMENT '主键',
  `TENANT_ID` varchar(20) DEFAULT NULL COMMENT '租户id',
  `DBS_ID` varchar(20) DEFAULT NULL COMMENT '数据源',
  `TABLE_NAME` varchar(255) DEFAULT NULL COMMENT '表名称',
  `SORT_CODE` int(11) DEFAULT NULL COMMENT '排序码',
  `NAME` varchar(255) DEFAULT NULL COMMENT '表单域属性名',
  `LABEL` varchar(255) DEFAULT NULL COMMENT '标签文本',
  `REQUIRED` tinyint(1) DEFAULT NULL COMMENT '必填',
  `PLACEHOLDER` varchar(255) DEFAULT NULL COMMENT '提示语',
  `TYPE` varchar(255) DEFAULT NULL COMMENT '类型',
  `SELECT_OPTION_TYPE` varchar(255) DEFAULT NULL COMMENT '选择项类型',
  `DICT_TYPE_CODE` varchar(255) DEFAULT NULL COMMENT '字典',
  `SEL_OPTION_API_URL` varchar(255) DEFAULT NULL COMMENT '选择项api地址',
  `SEL_DATA_API_URL` varchar(255) DEFAULT NULL COMMENT '已选择数据api地址',
  `IS_MULTIPLE` tinyint(1) DEFAULT NULL COMMENT '是否多选',
  `DELETE_FLAG` varchar(255) DEFAULT NULL COMMENT '删除标志',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `CREATE_USER` varchar(20) DEFAULT NULL COMMENT '创建用户',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `UPDATE_USER` varchar(20) DEFAULT NULL COMMENT '更新用户',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='动态字段配置';

